  false,\n\t\"url\": null,\n\t\"notes\": \"The National Marine Mammal Laboratories'
  California Current Ecosystem Program (AFSC/NOAA) in collaboration with Washington
  Department of Fish and Wildlife captured and sampled Pacific harbor seals (Phoca
  vitulina) to study the demography of this species in Washington. This database provides
  capture, recapture, branding and resighting information for harbor seals in Washington
  from 1981 to 2007. Datasets include: Captures, Recapture, and Resight.  Captures
  and Recapture information includes speno, date, age-class, age qualifier, sex, weight,
  length, health, tag number, brand number, location for all age classes and axial
  girth for pups and subadults.  It also notes if samples were taken for disease screening
  (blood and swabs), contaminants (blubber), genetics (skin) and if animals were instrumented
  and with what type(s) of instrument. Resights information includes speno, date,
  tag, brand, reproductive information, location.\",\n\t\"license_title\": null,\n\t\"extras\":
